import argparse
from collections import deque

# Inverted page table
class InvertedPageTable:
    def __init__(self, memory_size, page_size):
        self.memory_size = memory_size
        self.page_size = page_size
        self.num_pages = memory_size // page_size
        self.table = {}
        self.queue = deque()

    def get_page(self, page_number):
        if page_number in self.table:
            # update reference bit
            self.table[page_number] = 1
            if (page_number, 0) in self.queue:
                index = self.queue.index((page_number, 0))
                self.queue[index] = (page_number, 1)
            return True
        else:
            return False

    def add_page(self, page_number, is_dirty):
        if len(self.table) == self.num_pages:
            # perform Second Chance Page Replacement
            while True:
                page, ref_bit = self.queue.popleft()
                if ref_bit == 0:
                    del self.table[page]
                    break
                else:
                    self.table[page] = 0
                    self.queue.append((page, 0))
        self.table[page_number] = 1 if is_dirty else 0
        self.queue.append((page_number, 1))

    def reset(self):
        self.table = {}
        self.queue.clear()


# Enhanced page table
class EnhancedTable:
    def __init__(self, memory_size, page_size):
        self.memory_size = memory_size
        self.page_size = page_size
        self.num_pages = memory_size // page_size
        self.table = {}
        self.queue = deque()

    def get_page(self, page_number):
        if page_number in self.table:
            # update reference bit
            self.table[page_number] = 1
            if (page_number, 0) in self.queue:
                index = self.queue.index((page_number, 0))
                self.queue[index] = (page_number, 1)
            return True
        else:
            return False

    def add_page(self, page_number, is_dirty):
        if page_number in self.table:
            # Page is already in the table, update reference bit to 0
            self.table[page_number] = 0
            return  # No page fault

        # Page is not in the table, handle page fault
        page_fault = True

        # Check if the table has space
        if len(self.table) == self.num_pages:
            found_replacement = False

            # First full loop search for (0, 0) - neither recently used nor modified
            for _ in range(len(self.queue)):
                current_page, (ref_bit, dirty_bit) = self.queue.popleft()

                if ref_bit == 0 and dirty_bit == 0:
                    # Found a page with (0, 0), replace it
                    del self.table[current_page]
                    found_replacement = True
                    break
                else:
                    # Set reference bit to 0 and enqueue again
                    self.table[current_page] = 0
                    self.queue.append((current_page, (0, dirty_bit)))

            # If not found in the first loop, choose one of two cases
            if not found_replacement:
                for _ in range(len(self.queue)):
                    current_page, (ref_bit, dirty_bit) = self.queue.popleft()

                    if ref_bit == 0 and dirty_bit == 0:
                        # Case (0, 0) - reference bit 0, and modified bit 0
                        del self.table[current_page]
                        break
                    elif ref_bit == 0 and dirty_bit == 1:
                        # Case (0, 1) - reference bit 0, and modified bit 1
                        del self.table[current_page]
                        found_replacement = True
                        break
                    else:
                        # Set reference bit to 0 and enqueue again
                        self.table[current_page] = 0
                        self.queue.append((current_page, (0, dirty_bit)))

            # If still not found, perform another loop
            while not found_replacement:
                for _ in range(len(self.queue)):
                    current_page, (ref_bit, dirty_bit) = self.queue.popleft()

                    if ref_bit == 0:
                        # Replace when reference bit is 0
                        del self.table[current_page]
                        found_replacement = True
                        break
                    else:
                        # Set reference bit to 0 and enqueue again
                        self.table[current_page] = 0
                        self.queue.append((current_page, (0, dirty_bit)))

        # Add the new page to the table
        self.table[page_number] = 1 if is_dirty else 0
        self.queue.append((page_number, (1, is_dirty)))


    def reset(self):
        self.table = {}
        self.queue.clear()


def simulation(file_path, algorithm_choice, memory_size, page_size):
    # Initialize inverted page table or enhanced page replacement
    if algorithm_choice == "N":
        ipt = InvertedPageTable(memory_size * 1024, page_size * 1024)
    else:
        ipt = EnhancedTable(memory_size * 1024, page_size * 1024)

    # Parse input file and simulate page faults
    page_faults = 0
    with open(file_path, 'r') as f:
        for line in f:
            address, rw = line.strip().split()
            page_number = int(address, 16) // (page_size * 1024)
            is_dirty = True if rw == 'W' else False
            if not ipt.get_page(page_number):
                ipt.add_page(page_number, is_dirty)
                page_faults += 1

    # Print results
    print("Page size: {}KB, Memory size: {}KB".format(page_size, memory_size))
    algorithm_name = "Second Chance" if algorithm_choice == "N" else "Enhanced Second Chance"
    print("Page Replacement Algorithm:", algorithm_name)
    print("Number of page faults: {}".format(page_faults))

    # Reset page replacement algorithm for the next run
    ipt.reset()


if __name__ == "__main__":
    parser = argparse.ArgumentParser(description="Simulate page faults using Second Chance or Enhanced Second Chance algorithm.")
    parser.add_argument("file_path", help="Path to the input file")
    parser.add_argument("algorithm_choice", choices=["N", "E"], help="Choose N for Normal Second Chance or E for Enhanced Second Chance")
    parser.add_argument("memory_size", type=int, help="Memory size in KB")
    parser.add_argument("page_size", type=int, help="Page size in KB")

    args = parser.parse_args()
    simulation(args.file_path, args.algorithm_choice, args.memory_size, args.page_size)

function trackFoodInventory([input]) {
    let itemsPattern = /([#|])(?<food>[A-Za-z ]+)\1(?<date>\d{2}\/\d{2}\/\d{2})\1(?<calories>\d{1,5})\1/g;
    let currentItem = itemsPattern.exec(input);
    let allCalories = 0;
    let invetory = [];
    while (currentItem) {
        let { food, date, calories } = currentItem.groups;
        calories = Number(calories);
        allCalories += calories;
        invetory.push({'name': food, 'date': date, 'calories': calories});
        currentItem = itemsPattern.exec(input);
    }

    let daysWithFood = Math.floor(allCalories / 2000);
    console.log(`You have food to last you for: ${daysWithFood} days!`);
    if (invetory.length > 0) {
        invetory.forEach(product => console.log(`Item: ${product.name}, Best before: ${product.date}, Nutrition: ${product.calories}`));
    }
}

#ifndef RZUIGL_TESSELLATOR_H
#define RZUIGL_TESSELLATOR_H

#define FLOAT_TO_INT_BITS(floatVar) (*(int*) &floatVar)

#include "GL/glew.h"
#include "glm/glm.hpp"
#include "../glfw/deps/linmath.h"

class Tessellator {
private:
    int* rawBuffer;

    /**
     * The number of vertices to be drawn in the next draw call. Reset to 0 between draw calls.
     */
    int vertexCount;

    /**
     * The first coordinate to be used for the texture.
     */
    double textureU;

    /**
     * The second coordinate to be used for the texture.
     */
    double textureV;
    int brightness;

    /**
     * The color (RGBA) value to be used for the following draw call.
     */
    int color;

    /**
     * Whether the current draw object for this tessellator has color values.
     */
    bool hasColor;

    /**
     * Whether the current draw object for this tessellator has texture coordinates.
     */
    bool hasTexture;
    bool hasBrightness;

    /**
     * Whether the current draw object for this tessellator has normal values.
     */
    bool hasNormals;

    /**
     * The index into the raw buffer to be used for the next data.
     */
    int rawBufferIndex;

    /**
     * The number of vertices manually added to the given draw call. This differs from vertexCount because it adds extra
     * vertices when converting quads to triangles.
     */
    int addedVertices;

    /**
     * Disables all color information for the following draw call.
     */
    bool isColourEnabled = true;

    /**
     * The draw mode currently being used by the tessellator.
     */
public:
    int drawMode;

    /**
     * An offset to be applied along the x-axis for all vertices in this draw call.
     */
    double offsetX;

    /**
     * An offset to be applied along the y-axis for all vertices in this draw call.
     */
    double offsetY;

    /**
     * An offset to be applied along the z-axis for all vertices in this draw call.
     */
    double offsetZ;

    /**
     * The normal to be applied to the face being drawn.
     */
private:
    int normal;

    /**
     * Whether this tessellator is currently in draw mode.
     */
public:
    bool isDrawing;

    /**
     * The size of the buffers used (in integers).
     */
private:
    int bufferSize;

public:
    bool autoGrow;

public:

    explicit Tessellator(int bufferSize) {
        this->autoGrow = true;
        this->bufferSize = bufferSize;
        this->rawBuffer = new int[bufferSize];
        this->vertexCount = 0;
        this->textureU = 0;
        this->textureV = 0;
        this->brightness = 0;
        this->color = 0;
        this->hasColor = false;
        this->hasTexture = false;
        this->hasBrightness = false;
        this->hasNormals = false;
        this->rawBufferIndex = 0;
        this->addedVertices = 0;
        this->isColourEnabled = false;
        this->drawMode = 0;
        this->offsetX = 0;
        this->offsetY = 0;
        this->offsetZ = 0;
        this->normal = 0;
        this->isDrawing = false;
        this->bufferSize = 0;
        this->autoGrow = false;

    }

    /**
     * Draws the data set up in this tessellator and resets the state to prepare for new drawing.
     */
public:
    int draw() {
        if (!this->isDrawing) {
            // throw "Not tessellating!"
            return 0;
        }

        this->isDrawing = false;
        if (this->vertexCount > 0) {
            if (this->hasTexture) {
                glTexCoordPointer(2, GL_FLOAT, 32, (void*) (sizeof(float) * 3));
                glEnableClientState(GL_TEXTURE_COORD_ARRAY);
            }

            if (this->hasBrightness) {
                // OpenGlHelper.setClientActiveTexture(OpenGlHelper.lightmapTexUnit);
                glTexCoordPointer(2, GL_FLOAT, 32, (void*) (sizeof(int16_t) * 14));
                glEnableClientState(GL_TEXTURE_COORD_ARRAY);
                // OpenGlHelper.setClientActiveTexture(OpenGlHelper.defaultTexUnit);
            }

            if (this->hasColor) {
                glColorPointer(4, GL_UNSIGNED_BYTE, 32, (void*) 20);
                glEnableClientState(GL_COLOR_ARRAY);
            }

            if (this->hasNormals) {
                glNormalPointer(GL_FLOAT, 32, (void*) 24);
                glEnableClientState(GL_NORMAL_ARRAY);
            }

            glVertexPointer(3, GL_FLOAT, 32, this->rawBuffer);
            glEnableClientState(GL_VERTEX_ARRAY);
            glDrawArrays(this->drawMode, 0, this->vertexCount);
            glDisableClientState(GL_VERTEX_ARRAY);

            if (this->hasTexture) {
                glDisableClientState(GL_TEXTURE_COORD_ARRAY);
            }

            if (this->hasBrightness) {
                // OpenGlHelper.setClientActiveTexture(OpenGlHelper.lightmapTexUnit);
                glDisableClientState(GL_TEXTURE_COORD_ARRAY);
                // OpenGlHelper.setClientActiveTexture(OpenGlHelper.defaultTexUnit);
            }

            if (this->hasColor) {
                glDisableClientState(GL_COLOR_ARRAY);
            }

            if (this->hasNormals) {
                glDisableClientState(GL_NORMAL_ARRAY);
            }
        }

        int index = this->rawBufferIndex * 4;
        this->reset();
        return index;
    }

private:

    /**
 * Clears the tessellator state in preparation for new drawing.
 */
    void reset() {
        this->vertexCount = 0;
        this->rawBufferIndex = 0;
        this->addedVertices = 0;
    }

public:

    /**
    * Sets draw mode in the tessellator to draw quads.
    */
    void startDrawingQuads() {
        this->startDrawing(GL_QUADS);
    }

    /**
     * Resets tessellator state and prepares for drawing (with the specified draw mode).
     */

    void startDrawing(int glMode) {
        if (this->isDrawing) {
            return; // throw new IllegalStateException("Already tessellating!");
        }
        this->isDrawing = true;
        this->reset();
        this->drawMode = glMode;
        this->hasNormals = false;
        this->hasColor = false;
        this->hasTexture = false;
        this->hasBrightness = false;
        this->isColourEnabled = true;
    }

    /**
     * Sets the texture coordinates.
     */

    void setTextureUV(double u, double v) {
        this->hasTexture = true;
        this->textureU = u;
        this->textureV = v;
    }


    void setBrightness(int brightness) {
        this->hasBrightness = true;
        this->brightness = brightness;
    }

    /**
     * Sets the RGB values as specified, converting from floats between 0 and 1 to integers from 0-255.
     */

    void setColourOpaque(float r, float g, float b) {
        this->setColourOpaque((int) (r * 255.0F), (int) (g * 255.0F), (int) (b * 255.0F));
    }

    /**
     * Sets the RGBA values for the color, converting from floats between 0 and 1 to integers from 0-255.
     */

    void setColourRGBA(float r, float g, float b, float a) {
        this->setColourRGBA((int) (r * 255.0F), (int) (g * 255.0F), (int) (b * 255.0F), (int) (a * 255.0F));
    }

    /**
     * Sets the RGB values as specified, and sets alpha to opaque.
     */

    void setColourOpaque(int r, int g, int b) {
        this->setColourRGBA(r, g, b, 255);
    }

    /**
     * Sets the RGBA values for the color. Also clamps them to 0-255.
     */

    #define MIN(a,b) (a < b ? a : b)

    void setColourRGBA(int r, int g, int b, int a) {
        if (this->isColourEnabled) {
            this->hasColor = true;
            r = (r < 0 ? 0 : (MIN(r, 255)));
            g = (g < 0 ? 0 : (MIN(g, 255)));
            b = (b < 0 ? 0 : (MIN(b, 255)));
            a = (a < 0 ? 0 : (MIN(a, 255)));
            if (true) { // little endian
                this->color = a << 24 | b << 16 | g << 8 | r;
            }
            else {
                this->color = r << 24 | g << 16 | b << 8 | a;
            }
        }
    }

    #undef MIN

    void setColourRGBA(uint8_t r, uint8_t g, uint8_t b) {
        this->setColourOpaque(r & 255, g & 255, b & 255);
    }

    /**
     * Adds a vertex specifying both x,y,z and the texture u,v for it.
     */

    void addVertexWithUV(double x, double y, double z, double u, double v) {
        this->setTextureUV(u, v);
        this->addVertex(x, y, z);
    }


    void addVertex(glm::vec3 vec) {
        addVertex(vec.x, vec.y, vec.z);
    }


    void addVertex(glm::vec4 vec) {
        addVertex(glm::vec3(vec.x / vec.w, vec.y / vec.w, vec.z / vec.w));
    }

    /**
     * Adds a vertex with the specified x,y,z to the current draw call. It will trigger a draw() if the buffer gets full
     */

    void addVertex(double x, double y, double z) {
        if (this->rawBufferIndex >= this->bufferSize - 32 && this->autoGrow) {
            this->bufferSize *= 2;
            int* newRawBuffer = new int[this->bufferSize];
            memcpy(newRawBuffer, this->rawBuffer, this->rawBufferIndex * sizeof(int));
            delete[](this->rawBuffer);
            this->rawBuffer = newRawBuffer;
        }

        ++this->addedVertices;
        if (this->hasTexture) {
            float p1 = (float) this->textureU, p2 = (float) this->textureV;
            this->rawBuffer[this->rawBufferIndex + 3] = FLOAT_TO_INT_BITS(p1);
            this->rawBuffer[this->rawBufferIndex + 4] = FLOAT_TO_INT_BITS(p2);
        }

        if (this->hasBrightness) {
            this->rawBuffer[this->rawBufferIndex + 7] = this->brightness;
        }

        if (this->hasColor) {
            this->rawBuffer[this->rawBufferIndex + 5] = this->color;
        }

        if (this->hasNormals) {
            this->rawBuffer[this->rawBufferIndex + 6] = this->normal;
        }

        float pX = (float) (x + this->offsetX), pY = (float) (y + this->offsetY), pZ = (float) (z + this->offsetZ);
        this->rawBuffer[this->rawBufferIndex + 0] = FLOAT_TO_INT_BITS(pX);
        this->rawBuffer[this->rawBufferIndex + 1] = FLOAT_TO_INT_BITS(pY);
        this->rawBuffer[this->rawBufferIndex + 2] = FLOAT_TO_INT_BITS(pZ);
        this->rawBufferIndex += 8;
        ++this->vertexCount;

        if (this->autoGrow || this->addedVertices % 4 != 0 || this->rawBufferIndex < this->bufferSize - 32) {
            return;
        }

        assert(false);

        // throw new RuntimeException("Draw buffer overflow; too many vertices. Added = " + this->addedVertices + ", bufferSize = " + this->bufferSize + ", rawIndex = " + this->rawBufferIndex);

        // this->draw();
        // this->isDrawing = true;
    }

    /**
     * Sets the color to the given opaque value (stored as byte values packed in an integer).
     */

    void setColourOpaque(int colour) {
        int r = colour >> 16 & 255;
        int g = colour >> 8 & 255;
        int b = colour & 255;
        this->setColourOpaque(r, g, b);
    }

    /**
     * Sets the color to the given color (packed as bytes in integer) and alpha values.
     */

    void setColourRGBA(int rgb, int alpha) {
        int r = rgb >> 16 & 255;
        int g = rgb >> 8 & 255;
        int b = rgb & 255;
        this->setColourRGBA(r, g, b, alpha);
    }

    /**
     * Disables colors for the current draw call.
     */

    void disableColour() {
        this->isColourEnabled = false;
    }

    /**
     * Sets the normal for the current draw call.
     */
    void setNormal(float par1, float par2, float par3) {
        this->hasNormals = true;
        uint8_t var4 = (uint8_t) ((int) (par1 * 127.0F));
        uint8_t var5 = (uint8_t) ((int) (par2 * 127.0F));
        uint8_t var6 = (uint8_t) ((int) (par3 * 127.0F));
        this->normal = var4 & 255 | (var5 & 255) << 8 | (var6 & 255) << 16;
    }

    /**
     * Sets the translation for all vertices in the current draw call.
     */
    void setTranslation(double par1, double par3, double par5) {
        this->offsetX = par1;
        this->offsetY = par3;
        this->offsetZ = par5;
    }

    /**
     * Offsets the translation for all vertices in the current draw call.
     */

    void addTranslation(double x, double y, double z) {
        this->offsetX += x;
        this->offsetY += y;
        this->offsetZ += z;
    }

private:

    void draw(int startQuadVertex, int endQuadVertex) {
        int vxQuadCount = endQuadVertex - startQuadVertex;
        if (vxQuadCount > 0) {
            int startVertex = startQuadVertex * 4;
            int vxCount = vxQuadCount * 4;
            glTexCoordPointer(2, GL_FLOAT, 32, this->rawBuffer + (sizeof(float) * 3));
            // OpenGlHelper.setClientActiveTexture(OpenGlHelper.lightmapTexUnit);
            glTexCoordPointer(2, GL_FLOAT, 32, this->rawBuffer + (sizeof(int16_t) * 14));
            glEnableClientState(GL_TEXTURE_COORD_ARRAY);
            // OpenGlHelper.setClientActiveTexture(OpenGlHelper.defaultTexUnit);
            glColorPointer(4, GL_UNSIGNED_BYTE, 32, this->rawBuffer + 20);
            glVertexPointer(3, GL_FLOAT, 32, this->rawBuffer);
            glDrawArrays(this->drawMode, startVertex, vxCount);
        }
    }
};


