        private ApplicationContext _applicationContext = new ApplicationContext();

        private StateService _stateService;

        private FilesService _filesService;

        private static TelegramBotClient? _botClient;
        
        private async Task Init()
        {
          
            using CancellationTokenSource cts = new();
            
            _botClient = new TelegramBotClient("token");
            
            ReceiverOptions receiverOptions = new ()
            {
                AllowedUpdates = Array.Empty<UpdateType>() // receive all update types except ChatMember related updates
            };
            _botClient.StartReceiving(
                updateHandler: HandleUpdateAsync,
                pollingErrorHandler: HandlePollingErrorAsync,
                receiverOptions: receiverOptions,
                cancellationToken: cts.Token
            );
            _filesService = new FilesService(_botClient);
            _stateService = new StateService(_applicationContext);
            var me = await _botClient.GetMeAsync(cancellationToken: cts.Token);
            
            Console.WriteLine($"Start listening for @{me.Username}");
            Console.ReadLine();
        }

        private static Task HandlePollingErrorAsync(ITelegramBotClient botClient, Exception exception, CancellationToken cancellationToken)
