        public  async Task ShowMainMenu(long chatId, CancellationToken cancellationToken)
        {

            var currentUser = await _applicationContext.Users.FirstOrDefaultAsync(x => x.ChatId == chatId);
            
            ReplyKeyboardMarkup uploadBaseKeyboard = new(new[]
            {
                new KeyboardButton[] {Commands.UploadBaseCommand},
                new KeyboardButton[] {Commands.EditBaseCommand},
                new KeyboardButton[] {Commands.ShowUserInfo},
            })
            {
                ResizeKeyboard = true
            };

            await _botClient.SendTextMessageAsync(
                chatId: chatId,
                text: "Главное меню",
                replyMarkup: uploadBaseKeyboard,
                cancellationToken: cancellationToken);
            
        }
        
        public  async Task ShowUserInfo(long chatId, CancellationToken cancellationToken)
        {
            ReplyKeyboardMarkup uploadBaseKeyboard = new(new[]
            {
                new KeyboardButton[] {Commands.UploadBaseCommand},
                new KeyboardButton[] {Commands.EditBaseCommand},
                new KeyboardButton[] {Commands.ShowUserInfo},
            })
            {
                ResizeKeyboard = true
            };
            var currentUser = await _applicationContext.Users.FirstOrDefaultAsync(x => x.ChatId == chatId);
           
            var isBaseLoaded = currentUser?.Links.Count != 0 ? "✅База для проверки загружена" : "⛔️База для проверки не загружена";
            var text = $"👤Пользователь: {currentUser?.Name}. {Environment.NewLine}{isBaseLoaded}";
            
            await _botClient.SendTextMessageAsync(
                chatId: chatId,
                text: text,
                cancellationToken: cancellationToken);
            
        }
       
    }
