plugins {
    id "com.github.johnrengelman.shadow" version "7.1.2"
}

architectury {
    platformSetupLoomIde()
    fabric()
}

loom {
    accessWidenerPath = project(":common").loom.accessWidenerPath
}

configurations {
    common
    shadowCommon // Don't use shadow from the shadow plugin since it *excludes* files.
    compileClasspath.extendsFrom common
    runtimeClasspath.extendsFrom common
    developmentFabric.extendsFrom common
}

dependencies {
    modImplementation "net.fabricmc:fabric-loader:${rootProject.fabric_loader_version}"
    modApi "net.fabricmc.fabric-api:fabric-api:${rootProject.fabric_api_version}"
    // Remove the next line if you don't want to depend on the API
    modApi "dev.architectury:architectury-fabric:${rootProject.architectury_version}"
    implementation("org.reflections:reflections:0.10.2")

    common(project(path: ":common", configuration: "namedElements")) { transitive false }
    shadowCommon(project(path: ":common", configuration: "transformProductionFabric")) { transitive false }

    modImplementation "curse.maven:backpacked-fabric-667380:4728986"

    //modImplementation "com.mrcrayfish:framework-fabric:${minecraft_version}-${framework_version}"
    modImplementation "curse.maven:framework-fabric-667391:4718252"
    //modImplementation "dev.emi:trinkets:${trinkets_version}"
}

processResources {
    inputs.property "version", project.version

    filesMatching("fabric.mod.json") {
        expand "version": project.version
    }
}

shadowJar {
    exclude "architectury.common.json"

    configurations = [project.configurations.shadowCommon]
    archiveClassifier = "dev-shadow"
}

remapJar {
    injectAccessWidener = true
    input.set shadowJar.archiveFile
    dependsOn shadowJar
}

sourcesJar {
    def commonSources = project(":common").sourcesJar
    dependsOn commonSources
    from commonSources.archiveFile.map { zipTree(it) }
}

components.java {
    withVariantsFromConfiguration(project.configurations.shadowRuntimeElements) {
        skip()
    }
}

publishing {
    publications {
        mavenFabric(MavenPublication) {
            artifactId = rootProject.archives_base_name + "-" + project.name
            from components.java
        }
    }

    // See https://docs.gradle.org/current/userguide/publishing_maven.html for information on how to set up publishing.
    repositories {
        // Add repositories to publish to here.
    }
}

#include <stdio.h>

int main() {
	int ngay, thang, nam;
	printf("Nhap vao ngay/thang/nam: ");
	scanf("%d/%d/%d", &ngay, &thang, &nam);

	// Tính ngày hôm sau
	int ngayHomSau = ngay + 1;
	int thangHomSau = thang;
	int namHomSau = nam;
	switch (thangHomSau) {
		case 1: case 3: case 5: case 7: case 8: case 10: case 12:
			if (ngayHomSau > 31) {
				ngayHomSau = 1;
				thangHomSau++;
				if (thangHomSau > 12) {
					thangHomSau = 1;
					namHomSau++;
				}
			}
			break;
		case 4: case 6: case 9: case 11:
			if (ngayHomSau > 30) {
				ngayHomSau = 1;
				thangHomSau++;
				if (thangHomSau > 12) {
					thangHomSau = 1;
					namHomSau++;
				}
			}
			break;
		case 2:
			if (namHomSau % 400 == 0 || (namHomSau % 4 == 0 && namHomSau % 100 != 0)) {
				if (ngayHomSau > 29) {
					ngayHomSau = 1;
					thangHomSau++;
					if (thangHomSau > 12) {
						thangHomSau = 1;
						namHomSau++;
					}
				}
			} else {
				if (ngayHomSau > 28) {
					ngayHomSau = 1;
					thangHomSau++;
					if (thangHomSau > 12) {
						thangHomSau = 1;
						namHomSau++;
					}
				}
			}
			break;
	}

	// Tính ngày hôm qua
	int ngayHomQua = ngay - 1;
	int thangHomQua = thang;
	int namHomQua = nam;
	if (ngayHomQua == 0) {
		thangHomQua--;
		if (thangHomQua == 0) {
			thangHomQua = 12;
			namHomQua--;
		}
		switch (thangHomQua) {
			case 1: case 3: case 5: case 7: case 8: case 10: case 12:
				ngayHomQua = 31;
				break;
			case 4: case 6: case 9: case 11:
				ngayHomQua = 30;
				break;
			case 2:
				if (namHomQua % 400 == 0 || (namHomQua % 4 == 0 && namHomQua % 100 != 0)) {
					ngayHomQua = 29;
				} else {
					ngayHomQua = 28;
				}
				break;
		}
	}

	printf("Ngay hom sau la: %d/%d/%d\n", ngayHomSau, thangHomSau, namHomSau);
	printf("Ngay hom qua la: %d/%d/%d\n", ngayHomQua, thangHomQua, namHomQua);

	return 0;
}
